import React, { useEffect, useState } from 'react';


const BoxScoreGraph = (data) => {
    const instance = data.props;
    console.log(instance);
    const [ fgpHls, setFgpHls ] = useState(null);
    const [ fgpVls, setFgpVls ] = useState(null);

    const fgpV = Math.round((instance.vls.tstsg.fgm / instance.vls.tstsg.fga) * 100) + '%';
    const fgpH = Math.round((instance.hls.tstsg.fgm / instance.hls.tstsg.fga) * 100) + '%';


    useEffect(()=>{
        setFgpHls(fgpH);

        setFgpVls(fgpV);

        console.log(fgpHls);
        console.log(fgpVls);
    }, []);

    return (
        <div>
            {/* <!-- Vertical, rounded --> */}

            <div className="graph-container graph-vertical graph-rounded">

                <h2>Vertical, Rounded</h2>
                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>{ fgpHls }</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>75%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>65%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>20%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>34%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>82%</span>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    )
}

export default BoxScoreGraph;
